INSERT INTO `booster_school_languages` (`id`, `school_id`, `name`, `description`, `about_us`, `alias`) VALUES
(1, 1, '佐敦道官立小學', '辦學宗旨\r\n- 本著有教無類的精神，因材施教，啟發學生潛能。\r\n- 以「德、智、體、群、美」五育並重為目標，秉承「志於道，游於藝」之校訓，啟發學生個人潛能，服務及回饋社會。\r\n- 培養學生有正確價值觀及積極態度，達至全人發展，成為良好公民。\r\n\r\n', '佐敦道官立小學始創於一九五八年，在一九九三年九月轉為全日制小學。在秉承官立學校優良傳統下，本著有教無類及因材施教的辦學宗旨，因應時代變遷，不斷求進，提供創新學習環境及多元化活動，啟發學生潛能，為他們奠下良好基礎，迎接未來挑戰。。。。。', 'zho'),
(2, 1, 'Jordan Road Government Primary School', 'Our missions are:\r\n- Provide students with a pleasurable learning environment through a balanced coverage of ethical, intellectual, physical, social and aesthetic growth.\r\n- Establish positive attitudes and philosophy in students through life-wide learning and help them develop self-discipline and respect for whole-person development.\r\n- Develop biliterate and trilingual students with the ability to compute and use IT for life-long learning.\r\n- Achieve home-school cooperation and reinforce parental education to develop belongingness of students and parents in our school.', 'Jordan Road Government Primary School was established in 1958 and became a whole-day school in 1993. Adhering to the excellent heritage of government schools, we are committed to providing quality holistic education to students of all nationalities and potentials.  We strive to enhance our education to meet the needs of our ever-changing society. We provide students with an innovative learning environment and a wide variety of learning activities. We endeavor to nurture students’ self-confidence and self-motivation. We hope that we can inspire students to achieve their full potential and establish in them a good foundation to overcome challenges in the future.', 'eng'),
(3, 3, '全民學堂', '「全民學習科技控股有限公司」鑑於線下課堂的時間限制，為提昇香港人的學習環境，達到給予香港學生以至全港市民分分鐘學習的機會，我們推出 [全民學習] 網上教學全方位學習平台來延展課堂教育，當中由中小學校內課程、名校名師課程、大學進修課程、成人持續進修課程以至於校外興趣班課程等。我們希望每位香港人在學校課堂或工作之餘 , 可持續學習, 突破傳統學習體驗。\r\n', '「全民學習科技控股有限公司」鑑於線下課堂的時間限制，為提昇香港人的學習環境，達到給予香港學生以至全港市民分分鐘學習的機會，我們推出 [全民學習] 網上教學全方位學習平台來延展課堂教育，當中由中小學校內課程、名校名師課程、大學進修課程、成人持續進修課程以至於校外興趣班課程等。我們希望每位香港人在學校課堂或工作之餘 , 可持續學習, 突破傳統學習體驗。', 'zho'),
(5, 3, 'All4LeARN', '\"All4LeARN\" understands the limits of traditional classrooms. In order to enhance the learning environment, to offer the opportunity students and everyone in Hong Kong to learn anytime, we launched All4LeARN. The platform extends classroom education. It has courses for primary and secondary schools, courses from famous teachers, university refresher courses, continuing education courses for adults, and interest classes outside school. We hope that everyone will continue to learn and breakthrough the traditional learning experience after school or work.', '\"All4LeARN\" understands the limits of traditional classrooms. In order to enhance the learning environment, to offer the opportunity students and everyone in Hong Kong to learn anytime, we launched All4LeARN. The platform extends classroom education. It has courses for primary and secondary schools, courses from famous teachers, university refresher courses, continuing education courses for adults, and interest classes outside school. We hope that everyone will continue to learn and breakthrough the traditional learning experience after school or work.', 'eng'),
