(109, 1, '佐敦道官立小學', '辦學宗旨\r\n- 本著有教無類的精神，因材施教，啟發學生潛能。\r\n- 以「德、智、體、群、美」五育並重為目標，秉承「志於道，游於藝」之校訓，啟發學生個人潛能，服務及回饋社會。\r\n- 培養學生有正確價值觀及積極態度，達至全人發展，成為良好公民。\r\n\r\n', '佐敦道官立小學始創於一九五八年，在一九九三年九月轉為全日制小學。在秉承官立學校優良傳統下，本著有教無類及因材施教的辦學宗旨，因應時代變遷，不斷求進，提供創新學習環境及多元化活動，啟發學生潛能，為他們奠下良好基礎，迎接未來挑戰。。。。。', 'chi'),
(110, 3, '全民學堂', '「全民學習科技控股有限公司」鑑於線下課堂的時間限制，為提昇香港人的學習環境，達到給予香港學生以至全港市民分分鐘學習的機會，我們推出 [全民學習] 網上教學全方位學習平台來延展課堂教育，當中由中小學校內課程、名校名師課程、大學進修課程、成人持續進修課程以至於校外興趣班課程等。我們希望每位香港人在學校課堂或工作之餘 , 可持續學習, 突破傳統學習體驗。\r\n', '「全民學習科技控股有限公司」鑑於線下課堂的時間限制，為提昇香港人的學習環境，達到給予香港學生以至全港市民分分鐘學習的機會，我們推出 [全民學習] 網上教學全方位學習平台來延展課堂教育，當中由中小學校內課程、名校名師課程、大學進修課程、成人持續進修課程以至於校外興趣班課程等。我們希望每位香港人在學校課堂或工作之餘 , 可持續學習, 突破傳統學習體驗。', 'chi'),
